import React, { Component } from 'react';
import Prompt from '../Posts/Prompt'
import { Row, Col } from 'antd';

class Feed extends Component {

    getPrompts(){
        var posts = this.props.posts
        if(posts){
            return(
                posts.map((post,i) =>
                    <Col span={6} offset={6}>
                        <Prompt 
                            key={post.id} 
                            id={post.id} 
                            title={post.title} 
                            content={post.content}
                        />
                    </Col> 
                )
            )
        }
    }

    render() {
        return (
            <div>
                <Row>

                </Row>
                {this.getPrompts()}
            </div>
        );
    }
}

export default Feed;
